package main

import (
    "math"
)

// Compare determines how far off each guess was from the actual scores.
func Compare(game, guess []int) []int {
    result := make([]int, len(game))
    for i := range game {
        result[i] = int(math.Abs(float64(game[i] - guess[i])))
    }
    return result
}
